import{_ as a,c as e,o as t,aR as r}from"./chunks/framework.DinLaFdC.js";const b=JSON.parse('{"title":"开发日记","description":"","frontmatter":{"outline":[2,4]},"headers":[],"relativePath":"站长介绍/开发日记.md","filePath":"站长介绍/开发日记.md","lastUpdated":1713178204000}'),o={name:"站长介绍/开发日记.md"},h=r('<h1 id="开发日记" tabindex="-1">开发日记 <a class="header-anchor" href="#开发日记" aria-label="Permalink to &quot;开发日记&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>曾经的我可能很狂妄，心高气傲，年少轻狂，做网站就要做最炫酷的，写样式就要写最花里胡哨的，对不起，现在的我写代码，能跑就行</p></div><h2 id="_2024" tabindex="-1">2024 <a class="header-anchor" href="#_2024" aria-label="Permalink to &quot;2024&quot;">​</a></h2><h3 id="_2024-03" tabindex="-1">2024.03 <a class="header-anchor" href="#_2024-03" aria-label="Permalink to &quot;2024.03&quot;">​</a></h3><h4 id="_2024-03-29" tabindex="-1">2024.03.29 <a class="header-anchor" href="#_2024-03-29" aria-label="Permalink to &quot;2024.03.29&quot;">​</a></h4><p>小笔记本电脑用大学四年了，有时候突然就蓝屏重启了，唉，啥时候能遇见个富婆给我买台电脑[狗头]</p><h4 id="_2024-03-30" tabindex="-1">2024.03.30 <a class="header-anchor" href="#_2024-03-30" aria-label="Permalink to &quot;2024.03.30&quot;">​</a></h4><p>想写个鼠标悬浮显示二维码好难，因为基础不熟练，试了动画和定位，显示层级也搞不定，怀疑人生了。</p><p>现在摆平了，能显示就行，虽然说会影响页面布局。</p><h4 id="_2024-03-31" tabindex="-1">2024.03.31 <a class="header-anchor" href="#_2024-03-31" aria-label="Permalink to &quot;2024.03.31&quot;">​</a></h4><p>今天准备把资源链接放进去，昨天写了显示的样式 资源链接是从bobo哥网站下载的。免去了前期收集的过程。</p><p>我将日期定为四级标题，那么月份就是三级，年份就是二级，一级就是大标题-开发日记，哈哈，在一开始就定下运营跨越年份的日期。</p><p>今天给页脚加了个网站运行时间，感觉很酷，运行时间的开始使用的是电脑文件夹中星梦启航第一代网页可以找到的最早的的最后修改时间。2022年3月10日 15:32:00</p><p>将网站头部加入了百度分析，为啥不是谷歌分析，先搜的是谷歌分析，网站没看懂，就...百度了。</p><p>问了大佬的网站用的51.la,那我也用。所以访问分析用了百度统计和51.la两个</p><h4 id="_2024-04-01" tabindex="-1">2024.04.01 <a class="header-anchor" href="#_2024-04-01" aria-label="Permalink to &quot;2024.04.01&quot;">​</a></h4><p>今天早上尝试给网站加上谷歌搜索站点验证头标签</p><p>// <meta name="google-site-verification" content="0QTiVl6hixpkg_fJQSKH37g9Y5iqklaWYFXJRt20CgU"> // 谷歌搜索站点验证头标签 // 未成功。。。</p><p>登陆了github小号，stardreamfly，fork了仓库并运行在github pages</p><p>吃了个饭回来，谷歌检索成功了，估计不久后在谷歌就可以搜到我的博客内容了。</p><p>19.30</p><p>学习了base64，为什么是三个字节转化为4个字符，因为一个字节八位，64个字符可以代表6位，八和六的最小公倍数是24。妙啊</p><h4 id="_2024-04-02" tabindex="-1">2024.04.02 <a class="header-anchor" href="#_2024-04-02" aria-label="Permalink to &quot;2024.04.02&quot;">​</a></h4><p>今天准备加入一个爬虫工具箱的功能，俩面有一些常用的加密或者是爬虫功能</p><p>下午打了一下午游戏，爬虫工具箱的任务搁浅了。</p><p>投递了一份简历，少儿编程，听了下午的线上宣讲会。</p><h4 id="_2024-04-02-1" tabindex="-1">2024.04.02 <a class="header-anchor" href="#_2024-04-02-1" aria-label="Permalink to &quot;2024.04.02&quot;">​</a></h4><p>刚面试完，公司好像很好，48小时出结果</p><p>想创业了，公司名为驴马程序员，口号是：学it，月薪过百，就来驴马程序员。</p><h4 id="_2024-04-04" tabindex="-1">2024.04.04 <a class="header-anchor" href="#_2024-04-04" aria-label="Permalink to &quot;2024.04.04&quot;">​</a></h4><p>今天做了一点点毕设，待办事项，csdn草稿箱放验证码图片，验证码类型</p><h4 id="_2024-04-05" tabindex="-1">2024.04.05 <a class="header-anchor" href="#_2024-04-05" aria-label="Permalink to &quot;2024.04.05&quot;">​</a></h4><p>今天准备给网站加上elementplus的插件，自己手搓样式太难了。</p><h4 id="_2024-04-06" tabindex="-1">2024.04.06 <a class="header-anchor" href="#_2024-04-06" aria-label="Permalink to &quot;2024.04.06&quot;">​</a></h4><p>增多自己的信息获取渠道，去主动地学习而不是被动的前进。</p><p>今天好像又啥都没干，给博客网站加上一个算法专栏文章吧，把之前写的迁移进来。</p><h4 id="_2024-04-12" tabindex="-1">2024.04.12 <a class="header-anchor" href="#_2024-04-12" aria-label="Permalink to &quot;2024.04.12&quot;">​</a></h4><p>今天更新了23种设计模式到网站，CSDN，知识星球专栏，还有公众号的草稿箱。。。</p><h4 id="_2024-04-13" tabindex="-1">2024.04.13 <a class="header-anchor" href="#_2024-04-13" aria-label="Permalink to &quot;2024.04.13&quot;">​</a></h4><p>之前全网都改成 Python斗罗 了。</p><p>结果因为我抖音每次进直播间就会有小妹妹说欢迎斗罗，然后我就改成了Python爸爸。</p><p>所以只有抖音叫Python爸爸，其他都叫Python斗罗。</p><h4 id="_2024-04-14" tabindex="-1">2024.04.14 <a class="header-anchor" href="#_2024-04-14" aria-label="Permalink to &quot;2024.04.14&quot;">​</a></h4><p>工具箱和导航的央视好像有点丑，尝试重写优化下样式，另外增加新的资源网站类别，浏览器书签里的那些网站，然后再给这个页面加上分类筛选的功能，感觉工程量不小。。。</p><p>更换了网站导航页面鼠标悬浮样式，拟态风格</p><h4 id="_2024-04-15" tabindex="-1">2024.04.15 <a class="header-anchor" href="#_2024-04-15" aria-label="Permalink to &quot;2024.04.15&quot;">​</a></h4><p>准备给网站加上前端反爬虫，</p><p>给博客添加评论功能：教程： <a href="https://vitepress.yiov.top/plugin.html#%E8%AF%84%E8%AE%BA" target="_blank" rel="noreferrer">https://vitepress.yiov.top/plugin.html#评论</a></p><p>后续再添加点水印什么的吧，图片水印等等。。。</p><p>学会了控制显示文章导航栏层级，以及页面侧边栏的展开与折叠，比如23中设计模式页面的侧边栏：<a href="https://cpython666.github.io/Python/%E7%B3%BB%E5%88%97%E6%96%87%E7%AB%A0/23%E7%A7%8D%E8%AE%BE%E8%AE%A1%E6%A8%A1%E5%BC%8F/" target="_blank" rel="noreferrer">https://cpython666.github.io/Python/系列文章/23种设计模式/</a></p><p>看板娘添加失败</p><p>加入了图片缩放功能</p>',52),i=[h];function p(l,n,s,d,_,c){return t(),e("div",null,i)}const m=a(o,[["render",p]]);export{b as __pageData,m as default};
